import React from 'react';
import PropTypes from 'prop-types';

const AllergyItem = ({
  allergy: {
    vaccineName,
    note,
    date,
  }
}) => {
  return (
    <div >
    <h2 class="my-2">Allergy Recorded on {date}</h2>
      <table class="table">
        <thead>
          <tr>
            <th>Vaccine Name</th>
            <th>Expiry Date</th>
            <th>Batch/Lot Number</th>
            <th>Dose Quantity</th>
            <th>Performer's Name</th>
            <th>Institution Name</th>
            <th>Institution Type</th>
            <th>Location</th>
            <th>Note</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>{vaccineName}</td>
            <td>{note}</td>
          </tr>
        </tbody>
      </table>
    </div>  
      
  );
};

AllergyItem.propTypes = {
  allergy: PropTypes.object.isRequired
};

export default AllergyItem;
